import React, { useState } from 'react';
import './ProfilePage.css';

const ProfilePage = () => {
  const [selectedMenu, setSelectedMenu] = useState('My Programs'); // Default menu item

  const menuItems = [
    'Your Profile',
    'My Programs',
    'My Diet Plans',
    'My Articles',
    'My Medical History',
    'My Progress',
    'My Trainer',
    'My Subscription',
  ];

  const renderContent = () => {
    switch (selectedMenu) {
      case 'My Programs':
        return (
          <div className="content">
            <img src="v1.jpg" alt="Program 1" />
            <img src="v2.jpg" alt="Program 2" />
            <img src="v3.jpg" alt="Program 3" />
          </div>
        );
      case 'Your Profile':
        return <div>Your profile information goes here.</div>;
      case 'My Diet Plans':
        return <div>Diet plans go here.</div>;
      // Add more case blocks for other menu items as needed.
      default:
        return <div>Select an option from the menu.</div>;
    }
  };

  return (
    <div className="profile-page">
      <div className="sidebar">
        <ul>
          {menuItems.map((item, index) => (
            <li key={index} onClick={() => setSelectedMenu(item)}>
              {item}
            </li>
          ))}
        </ul>
      </div>

      <div className="profile-content">
        <div className="profile-header">
          <div className="profile-pic-container">
            <img className="profile-pic" src="p.jpg" alt="Profile" />
          </div>
        </div>
        <div className="main-content">{renderContent()}</div>
      </div>
    </div>
  );
};

export default ProfilePage;
